                <div className="row">
                    <div className="col-3"></div>
                    <div className="col-6" id="outbox">

                        <div className="row"><div className="col-4 mt-3"><p id="namep">{fdata.componentMount}</p></div> <div className="col-4"></div><div className="col mt-3"><p id="phonep"> 09987654323</p></div></div>
                        <div className="row"><div className="col"><p id="mailp">Abc@gmail.com</p></div></div>
                        <div className="row"><div className="col mt-3 mb-3"><p id="addp"> Bihar, kjamuiokh, india 786576: sector A</p></div></div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default showData
